import { student_store } from "../store/student_store.js";
 
import { add_Student } from '../action/addAction.js';
import { addActioncreator } from '../action/addAction.js';
import { combineReducers } from 'redux';
function student_reducer(state = student_store, action) {

    switch(action.type)
        {
        case add_Student:
        {
            return state;
        }
        default:
            return state;
       }
}
const rootreducer = combineReducers({ student_reducer });
    export default rootreducer;
